import React, { useEffect } from 'react';

function Navermap() {
	const { naver } = window;

	useEffect(() => {
		const location = new naver.maps.LatLng(37.50663, 127.10427);
		// 지도에 표시할 위치의 위도와 경도 설정

		const mapOptions = {
			center: location,
			// 중앙에 배치할 위치
			zoom: 17,
			// 확대 단계
		};
		const map = new naver.maps.Map('map', mapOptions);
		// DOM 요소에 지도 삽입 (지도를 삽입할 HTML 요소의 id, 지도의 옵션 객체)
		const markers = new naver.maps.Marker({
			map,
			position: location,
		});
		// 지도에 마커 생성
	}, []);

	return <div id="map" style={{ width: '500px', height: '500px' }} />;
}

export default Navermap;
